import React from "react";
export default class AddPrizeModal extends React.Component {


  render() {
    if(!this.props.addTicket){
          return null;
      }

    return (
      <React.Fragment>
      <div className="Modal">
      <div className="at-modalmain">
      <p className="at-text">'Award ' + {this.props.user} + ' ' + {this.props.price}  + "?"</p>
      </div>
      </div>
      </React.Fragment>
    )
  }
}
